import React from "react"

export default function TrackSearchResult({ track, chooseTrack }) {
  function handlePlay() {
    chooseTrack(track)
  }
  return (
    <div className="flex m-2 align-items-center bg-secondary" style={{ cursor: "pointer" }} onClick={handlePlay}>
        <img className="" src={track.albumUrl} style={{ height: "64px", width: "24px" }} alt="" />
        <div className="ml-3">
        <div>{track.title}</div>
        <div className="text-muted">{track.artist}</div>      
       </div>
      
    </div>
  )
}
